import{_ as e,o as t,c as i,O as r}from"./chunks/framework.9482e208.js";const p=JSON.parse('{"title":"§ 56-594.1 Interconnection by farms.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/56-594.1.md","filePath":"vacode/56-594.1.md"}'),a={name:"vacode/56-594.1.md"},n=r('<h1 id="§-56-594-1-interconnection-by-farms" tabindex="-1">§ 56-594.1 Interconnection by farms. <a class="header-anchor" href="#§-56-594-1-interconnection-by-farms" aria-label="Permalink to &quot;§ 56-594.1 Interconnection by farms.&quot;">​</a></h1><p>A. As used in this section, &quot;eligible farm&quot; means an entity that owns or operates facilities within the Commonwealth for the generation of electric energy, which entity is described in subdivision (b)(10) of § <a href="http://law.lis.virginia.gov/vacode/56-265.1/" target="_blank" rel="noreferrer">56-265.1</a>.</p><p>B. Eligible farms shall be permitted to connect to the electrical grid in order to feed into the grid electricity generated by the eligible farm from its facilities that generate electricity from a waste-to-energy technology.</p><p>C. The Commission shall adopt regulations to implement this section pursuant to § <a href="http://law.lis.virginia.gov/vacode/56-578/" target="_blank" rel="noreferrer">56-578</a>.</p><p>2009, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?091+ful+CHAP0746" target="_blank" rel="noreferrer">746</a>.</p>',5),o=[n];function c(s,l,h,d,f,_){return t(),i("div",null,o)}const g=e(a,[["render",c]]);export{p as __pageData,g as default};
